INSERT INTO `pages_tbl` VALUES (1,'About Us','about_us','<h4>About Us</h4>\r\n<p>Auto Online is a web portal, which facilitate buyers, suppliers and service providers to meet in an online flatform. Buyers can search for suitable suppliers for the vehicle parts or services they require. autoonline.lk works as a search engine for automobile parts and services.</p>\r\n\r\n<p>There is no joining fee or subscription fee for a supplier to register and publish his company name and product information on autoonline.lk. Registered suppliers will receive customer requirements on their WhatsApp account. Buyers log on to autoonline.lk and search for suppliers. Once the buyer finds a suitable supplier, the buyer can share the requirement along with the product description and a related photo of the defected item.</p>\r\n\r\n<p>With reference to the buyer\'s inquiry, suppliers can check for the availability of the requested item and make their own quotations using the quotation software provided on the autoonline.lk website. Based on the supplier\'s quotation, if the customer chooses to purchase from the supplier, the customer can place the order online and pay via the payment gateway to the supplier, or can choose cash on delivery. Auto Online has no delivery system, it is a collective responsibility between the customer and the supplier.</p>\r\n\r\n<p>Autoonline.lk works as a search engine and autoonline.lk website, and the quality of goods and services is the responsibility of the supplier and the buyer, respectively. Autoonline.lk has provided the facility to evaluate and rate the service and product of registered suppliers. The responsibility for guarantees and warrantees should be taken care of by the supplier.</p>\r\n				','6.9271','79.8612','','','','','','','','2020-12-27 22:41:55'),(2,'Contact Us','contact_us','<p>Auto Online is a web portal, which facilitate buyers, suppliers and service providers to meet in an online flatform. Buyers can search for suitable suppliers for the vehicle parts or services they require. autoonline.lk works as a search engine for automobile parts and services.</p>\r\n',' 79.94802','6.85042','','','','No 45/4 B block,Borella,Sri Lanka.','94753813398','94753813398','info@autoonline.lk','2020-12-27 22:41:55'),(3,'Terms & Conditions','terms_conditions','<ul>\r\n<li>If users abuse the website or mobile app in any way, autoonline.com can terminate their account. Autoonline.com \"Termination\" clause can inform users that their accounts would be terminated if they abuse our service.</li>\r\n<li>If users can post content on our website or mobile app (create content and share it on our platform), we can remove any content they created if it infringes copyright. Our Terms and Conditions will inform users that they can only create and/or share content they own rights to. Similarly, if users can register for an account and choose a username, we can inform users that they are not allowed to choose usernames that may infringe trademarks, i.e. usernames like Google, Facebook, and so on.</li>\r\n<li>We could cancel specific orders if a product price is incorrect. Our Terms and Conditions can include a clause to inform users that certain orders, at our vendors, can be canceled if the products ordered have incorrect prices due to various errors.</li>\r\n\r\n</ul>','79.8612','6.9271','','','','','','','','2020-12-27 22:41:55'),(4,'Privacy Policy','privacy_policy','<h5><b>Who we are</b></h5>\r\n<p>Our website address is: https://autoonline.lk</p>\r\n\r\n<h5><b>What personal data we collect and why we collect it</b></h5>\r\n\r\n<h5><b>Comments</b></h5>\r\n\r\n<p>When visitors leave comments on the site, we collect the data shown in the comments form, and also the visitor\'s IP address and browser user agent string to help spam detection.</p>\r\n\r\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\r\n\r\n<h5><b>Media</b></h5>\r\n\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n\r\n<h5><b>Contact forms</b></h5>\r\n\r\n<h5><b>Cookies</b></h5>\r\n\r\n<p>If you leave a comment on our site, you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.\r\nIf you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.\r\nIf you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n\r\n<h5><b>Embedded content from other websites</b></h5>\r\n\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n\r\n<h5><b>Analytics</b></h5>\r\n\r\n<h5><b>Who we share your data with</b></h5>\r\n\r\n<h5><b>How long we retain your data</b></h5>\r\n\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n\r\n<h5><b>What rights you have over your data</b></h5>\r\n\r\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\r\n\r\n<p><b>Where we send your data</b></p>\r\n\r\n<p>Visitor comments may be checked through an automated spam detection service.</p>\r\n\r\n','79.8612','6.9271','','','','','','','','2020-12-27 22:41:55'),(5,'Delivery information','delivery_information','\r\n<p>Autoonline.lk is a platform where customers and buyers meet online and exchange product information and prices. Delivery of goods from the supplier\'s location to the customer\'s location should be organized by the customer and supplier at their convenience, either by way of pickup or delivery. Autoonline.lk has no responsibility for the delivery of goods from the supplier location to the customer location. The charge for deliveries is decided by the supplier based on the size of the product, distance, and mode of transportation.</p>',' 80.01617','6.7519','','','','','0112731460','77-7276868','','2020-12-27 22:41:55'),(6,'Careers','careers','<p>autoonline.com invite to register freelance automobile parts brokers and do online business with autoonline.lk. the broker has to create an account with username and password to receive customer inquiries. The broker can send the quotations and get their online orders.</p>',' 80.01617','6.7519','','','','','0112731460','77-7276868','','2020-12-27 22:41:55'),(7,'Buying Guide','buying_guide','<p>Donec ultricies, mi vel accumsan semper, ipsum lectus lacinia erat, et luctus orci eros sit amet orci. Vestibulum ut aliquam felis. Fusce non nisi at velit hendrerit elementum. Integer blandit gravida enim eu tempus. Aenean a risus massa. Nam convallis dui sed pulvinar bibendum. Donec tincidunt sed lorem in venenatis. Nam malesuada molestie ex eu faucibus.</p>\r\n					<p>Vestibulum tortor diam, tempus sed dui id, maximus tristique metus. Proin et ligula eget neque tristique ullamcorper eget sed turpis. Interdum et malesuada fames ac ante ipsum primis in faucibus. Aenean a lobortis ante, vel tincidunt risus. In eget auctor orci. Donec tincidunt mauris ut tellus mollis, at mattis felis convallis.</p>\r\n					<p>Cras efficitur fermentum velit sit amet vulputate. Aliquam vitae feugiat libero. Sed ut scelerisque lacus. Donec viverra tellus nunc, in porta tortor sodales id. Integer eget neque eu justo laoreet rhoncus.Donec ultricies, mi vel accumsan semper, ipsum lectus lacinia erat, et luctus orci eros sit amet orci. Vestibulum ut aliquam felis. Fusce non nisi at velit hendrerit elementum. Integer blandit gravida enim eu tempus. Aenean a risus massa.Donec ultricies, mi vel accumsan semper, ipsum lectus lacinia erat, et luctus orci eros sit amet orci. Vestibulum ut aliquam felis. Fusce non nisi at velit hendrerit elementum. Integer blandit gravida enim eu tempus. Aenean a risus massa.</p>\r\n					<p>Sed rhoncus, metus non scelerisque feugiat, augue tellus conseq